    "text": "Dolnoslezské vojvodství vzniklo v roce 1999 na území dřívějších vojvodství: vratislavského, lehnického, jelenohorského, valbřišského a části kališského a lešenského. Patří mezi středně velká a hustěji osídlená vojvodství; ke konci roku 2017 zde žilo 2 902 000 obyvatel. Hlavním městem Dolnoslezského vojvodství je Vratislav (Wrocław)",
