    "id": "lubusske",
    "nazev": "Lubušské vojvodství",
    "znak": "lubuse.svg",
    "text":"Lubušské vojvodství leží na západě Polska v severozápadní části polské části Slezska, na severovýchodě polské části Lužice, jihovýchodní části Lubušska a v západní části Velkopolska. V rámci Polska sousedí s Dolnoslezským, Velkopolským a Západopomořanským vojvodstvím; dále pak s Německem (spolkové země Sasko a Braniborsko). Do roku 1945 náležela většina území k pruské provincii Braniborsku (tzv. Nová marka), území na jihu pak k pruské provincii Slezsku. Hlavním městem Lubušského vojvodství je Gorzów Wielkopolski.",
