    "text":"Západopomořanské vojvodství leží na severozápadě Polska především na východě Pomořanska, nicméně zasahuje i do Velkopolska a Lubušska. V rámci Polska sousedí s Pomořanským, Velkopolským a Lubušským vojvodstvím; dále pak s Německem (spolkové země Braniborsko a Meklenbursko-Přední Pomořansko). Hlavním městem Západopomořanského vojvodství je Štětín (Szczecin).",
